import React, {useEffect, useState} from "react";
import "./CreatePost.css";
import {Link} from "react-router-dom";
import {PostDraft} from "./PostDraft";
import ProfilePictureService from "../../../../services/ProfilePictureService";
import {isUserLoggedIn} from "../../../../services/AuthService";
import {Tooltip} from "react-tooltip";
import config from "../../../../config/config";

export const CreatePost = () => {
  const [draftOpen, setDraftOpen] = useState(false);
  const [userImage, setUserImage] = useState("data:image/svg+xml;base64,");

  const handleCreatePostClick = (): void => {
    if (isUserLoggedIn()) {
      setDraftOpen(!draftOpen);
    }
  };

  useEffect((): void => {
    ProfilePictureService.fetchUserImage(setUserImage);
  }, []);

  return (
      <div data-tooltip-id="create-post" data-tooltip-content={config.tooltipMessage}
           className={`create-post ${isUserLoggedIn() ? 'allowed' : 'not-allowed'}`}>
        <Link to="/profile" aria-label="To the profile">
          <img className={`profile-picture-create-post ${isUserLoggedIn() ? 'allowed' : 'not-allowed'}`} src={userImage} alt="Profile"/>
        </Link>
        <div className={`post-text-area ${isUserLoggedIn() ? 'allowed' : 'not-allowed'}`} onClick={handleCreatePostClick}>
          <input className={`post-input-field ${isUserLoggedIn() ? 'allowed' : 'not-allowed'}`} name="create-post-input"
                 placeholder="Write something..." readOnly={!isUserLoggedIn()}/>
        </div>
        <button className="create-post-button" disabled={!isUserLoggedIn()}>
          <div onClick={handleCreatePostClick} className="button-label">
            + Create post
          </div>
        </button>
        {draftOpen && (
            <PostDraft draftOpen={draftOpen} setDraftOpen={setDraftOpen}/>
        )}
        {!isUserLoggedIn() && (
            <Tooltip opacity={"100%"} variant={"light"} id="create-post" place="top" style={{ marginTop: "25px", zIndex: 999999 }}/>
        )}
      </div>
  );
};